import React, { useState } from 'react'
import ReactDOM from 'react-dom'

const App = () => {
  const [ counter, setCounter ] = useState(0)

  const handleClick = () => {
    console.log('clicked')
  }

  return (
    <div>
      <div>{counter}</div>
      <button onClick={() => setCounter(counter + 1)}>
  			plus
			</button>
			<button onClick={() => setCounter(0)}> 
			  zero
			</button>
    </div>
  )
}

ReactDOM.render(
  <App />, 
  document.getElementById('root')
)
